import React from "react";
import "../stylesheets/Home.css";
import pizza from "../Images/pizza.jpg";

const Home = () => {
  return (
    <div className="body col-12">

      <div className="image">
        <img src={pizza} alt="" />
      </div>
    </div>
  );
};

export default Home;
